import React from 'react';
import { MemoryRouter } from 'react-router-dom';
import './App.scss';
import Title from './components/Title/Title.jsx';

export default function App() {
  return (
    <MemoryRouter initialEntries={["/title", "/join", ]} initialIndex={1}>
      <Title/>
    </MemoryRouter>
  );
}
